import { Route, Routes } from "react-router-dom"
import StartDictation from "../StartDictation/StartDictation"

const DictationRoutes = () => {
    <div>
        <Routes>
            <Route path='/startDictation' element={<StartDictation />}></Route>
        </Routes>
    </div>
}

export default DictationRoutes;
